import React from "react"

import MenuPages from '../MenuPages'
import styles from './Login.module.css'
import ScrollToTop from "../ScrollToTop"

function Login() {
    return(
        <div className={styles.body}>
            <ScrollToTop />
            <MenuPages />
            
        </div>
    )
}

export default Login
